import Layout from '../components/Layout';
import Image from 'next/image';

const Resume = () => (
  <Layout>
    <div>
      <h1>Resume</h1>
      <p>Coming Soon</p>
    </div>
    <div>
      <Image
          alt="resume-page-2"
          src="/resume-page2.png"
          layout="intrinsic"
          width={600}
          height={800}
          />
    </div>
  </Layout>
  );

  export default Resume;
